import React ,{ useEffect, useState} from "react";
import axios from 'axios'

const DroneData = () => {
      axios({
        method: 'get',
        url: `https://assignments.reaktor.com/birdnest/drones`,
        withCredentials: false,
        params: {
          access_token: SECRET_TOKEN,
        },
      });
}

export default DroneData;
